style.css:
@-moz-document domain("www.centrelink.gov.au"), domain("my.gov.au") {
/*Dark Scrollbar*/
::-webkit-scrollbar { width: 10px; }
::-webkit-scrollbar-track { background: #fff0; }
::-webkit-scrollbar-thumb { background: #222; }
::-webkit-scrollbar-thumb:hover { background: #252525; }

body, html,

.authenticated-container__page,




.q-container, .questions-wrapper .q-container:nth-child(even)
{
  background: #3d3d3f;
}

.callout-2,

.card-grid .card-tile,

.inbox-list-item,

.unauth .login-card, .unauth .digital-id-main-login-card,

.light-grey-bg,
.genre-carousel-item .item-box,

.latest-updates-carousel-item .item-box,



.authenticated-container__nav,
.centrelink-tasks__tile,
.linked-services__list--item .list-link,
.key-message-container,

.authenticated-inbox .inbox-list__folders, .authenticated-inbox .inbox-list__messages,
.authenticated-inbox .inbox-list__folders ul>li>a.is-selected, .authenticated-inbox .inbox-list__folders ul>li>label.is-selected,

.authenticated-inbox .inbox-list__folders ul>li>a:hover, .authenticated-inbox .inbox-list__folders .btn-add-folder:hover,
.pagination>li a,

.authenticated-inbox .inbox-list__communication-view .communication-content,

.profile__callout,




.list-group-item,
.dhs-callout--alternate,
.lp-body-messages .lp-body-no-messages,

ol.breadcrumb, .breadcrumb-container,
.dhs-page-alert, .dhs-card,
.dhs-table>*>tr.dhs-table-accordion-title>td, .dhs-table>*>tr.dhs-table-accordion-title>th,

.dls-upload-btn,

.bg-grey,
.table-striped>tbody>tr:nth-child(odd),

.menu-item-viewPage,

.todo-container
{
    background: #363639;
}

input, textarea, select,

.card__title, .card:hover, .card:active,

a.inbox-list-item-link:focus, a.inbox-list-item-link:hover,

footer[role='contentinfo'],

.react-multi-carousel-list .carousel-item,
.page-anchors__links li a:focus, .page-anchors__links li a:hover, .page-anchors__links li span:focus, .page-anchors__links li span:hover,

.custom-button, .carousel-button-group,


.authenticated-container__nav .nav-sidebar__top--logout, .authenticated-container__nav .nav-sidebar__top .nav-sidebar-link,

.genre-carousel-container .react-multi-carousel-item .item-box,

.authenticated-inbox .inbox-list__folders,

.authenticated-inbox .inbox-list__folders ul>li>label:hover, .authenticated-inbox .inbox-list__messages ul>li>a:hover, .authenticated-inbox .inbox-list__messages ul>li>label:hover,

.authenticated-inbox .inbox-list__communication-view .communication-content__header .comm-attachment,

.profile__panel,



.landing-right .favs,
.footer,
.dhs-table-accordion-panel>td>.dhs-accordion-panel,

.table-total tfoot, .table-total thead,

a.menu-item-viewPage:hover, a.menu-item-viewPagefocus, a.menu-item-viewPage:active
{
    background-color: #2e2e2f !important;
}

.outage
{
    background: #3c3636;
}

.active-viewPage 
{
    background-color: #1378AF;
}

.wrapper-mapwap .digital-id-main-login-card, .unauth .digital-id-main-login-card,

.authenticated-container__nav .nav-sidebar__top--logout.is-active, .authenticated-container__nav .nav-sidebar__top .nav-sidebar-link.is-active
{
  background: #3d3d3f !important;
}

.wrapper-mapwap a.anchor, .unauth a.anchor
{
  background: #0000;
}

.drop-down:before, .drop-down ul, .drop-down__item
{
  background: #183052;
}
.drop-down__item:hover
{
  background: #0b1a2f;
}

body, h1, h2, h3, h4, h5, h6, input, textarea, select,

.card__title,
.meta-info__user,

a.inbox-list-item-link *,

footer[role='contentinfo'],

.page-anchors__links li a, .page-anchors__links li span,
.section-heading a,

.wrapper-mapwap form label, .wrapper-mapwap form .std-Legend, .unauth form label, .unauth form .std-Legend,



.authenticated-container__nav .nav-sidebar__top--logout, .authenticated-container__nav .nav-sidebar__top .nav-sidebar-link,

.welcome__heading--text,
.welcome__personal-detail,

.linked-services__list--item .list-link *,

.input-group label,

ul *, .authenticated-inbox .inbox-list__folders .btn-add-folder,

.authenticated-inbox .inbox-list__communication-view .communication-content__header .comm-provider, .authenticated-inbox .inbox-list__communication-view .communication-content__header .comm-subject,

.profile__panel *, .profile__callout *,




.breadcrumbs a,

.dhs-callout--alternate,
table.dhs-table thead *,

.dls-upload-btn, .qText,

.select-table a,

.todo-container *
{
  color: #ccc !important;
}

.most-viewed-carousel-item p,
.latest-updates-carousel-item .item-box .description,
p
{
  color: #999;
}

.moc-dark
{
  color: #2e2e2f !important;
}

*
{
  border: none !important;
  box-shadow: none !important;
}

.authenticated-container__nav .nav-sidebar__top
{
  position: relative;
  right: -20px;
}

.authenticated-container__nav .nav-sidebar__top.is-fixed 
{
    position: fixed;
    top: 0;
    left: 20px;
}
.authenticated-container__nav .nav-sidebar__top>ul li:last-child
{
  right: 40px;
}

.footer-logo,
.most-viewed-carousel-item img,

.authenticated-container__nav .nav-sidebar__top--logout.is-active, .authenticated-container__nav .nav-sidebar__top .nav-sidebar-link.is-active svg,
.drop-down__active a svg,

.input-group--sort.input-group label:before,



.icon-payment-plan,

.moac-claim-status-icon .fa-stack-1x
{
    filter: invert(1) hue-rotate(195deg) saturate(4) brightness(2);
    mix-blend-mode: color-dodge;
}
}
